    scaleSprite (sprite, availableSpaceWidth, availableSpaceHeight, scaleMultiplier) {
        var scale = this.getSpriteScale(sprite.width, sprite.height, availableSpaceWidth, availableSpaceHeight);
        sprite.setScale(scale * scaleMultiplier);
    }

    getSpriteScale (spriteWidth, spriteHeight, availableSpaceWidth, availableSpaceHeight) {
        var ratio = 1;
        var currentDevicePixelRatio = window.devicePixelRatio;
        // Sprite needs to fit in either width or height
        var widthRatio = (spriteWidth * currentDevicePixelRatio + 2 ) / availableSpaceWidth;
        var heightRatio = (spriteHeight * currentDevicePixelRatio + 2 ) / availableSpaceHeight;
        if(widthRatio > 1 || heightRatio > 1){
            ratio = 1 / Math.max(widthRatio, heightRatio);
        }
        return ratio * currentDevicePixelRatio;
    }

    scaleSpriteTween(sprite, availableSpaceWidth, availableSpaceHeight, scaleMultiplier) {
        var scale = this.getSpriteScale(sprite.width, sprite.height, availableSpaceWidth, availableSpaceHeight);
        this.tweens.chain({targets: sprite, tweens:[{scale: {value:scale * (scaleMultiplier+0.2)}, duration: 400,  ease: 'sine.in'}, {scale: {value:scale * scaleMultiplier}, duration: 250,  ease: 'sine.out'}]}); 
    }

    moveTo(sprite,_x,_y){
        this.tweens.add({targets: sprite, x:_x, y:_y, duration: 600, ease: 'Sine.InOut'});
    }

    popup(sprite, time) {
        if (time == undefined) time = 0
        this.tweens.add({targets: sprite, scale: {value: '+=0.035'}, delay: time, duration: 300, yoyo:true, ease: 'Sine.InOut'});
    }

    pulse(sprite) {
        this.tweens.add({targets: sprite, scale: {value: sprite.scaleX+0.05},duration: 500, yoyo:true, repeat:-1, ease: 'sine.inOut'})
    }

    flip(sprite, time, frame) {
        if (time == undefined) time = 0
        var orgX = sprite.scaleX

        this.time.delayedCall(time+250,()=>{
            sprite.setFrame(frame)
        },this)

        this.tweens.add({targets: sprite, scaleX: 0,duration: 300, delay:time, yoyo:true, ease: 'sine.inOut'})
    }

    shuffle(time){
        this.time.delayedCall(time,()=>{
            var isLandscape = window.innerHeight / window.innerWidth  < 1.3 ? true: false;
            const children = this.myCards.getChildren();
            var limit = 1

            for (let i = 0; i < children.length; i++)
            {   
                if(i+limit >=3) limit = -2

                if(!isLandscape)
                    this.tweens.add({targets: children[i],y: children[i+limit].y,duration: 400, ease: 'sine.inOut'})
                else
                    this.tweens.add({targets: children[i],x: children[i+limit].x,duration: 250, ease: 'sine.inOut'})
            }

        }, )
    }

