    tapObject(object){
        if(!this.canTap) return

        if(!this.music.isPlaying)
            this.music.play()

        this.hand.setAlpha(0)
        object.ready = false
        object.disableInteractive()
        object.postFX.addShine(0.8)
        this.confetti.start()
        this.flipSFX.play()
        this.flip(object, 0 , 'gift_cards_amazon.png')

        this.time.delayedCall(500,()=>{
        const children = this.myCards.getChildren();

            for (let i = 0; i < children.length; i++){
                if(children[i].ready == true){
                    children[i].disableInteractive()
                    this.flip(children[i], 0, 'rpcard.png')
                }
            }

            this.time.delayedCall(1800,()=>{
                this.cameras.main.fadeOut(500, 241, 198, 68);
                this.cameras.main.on('camerafadeoutcomplete', function () {
                    this.cameras.main.fadeIn(500, 241, 198, 68)
                    this.startCTA()
                }, this);
            })
        })
    }

